import React from "react";

const categories = [
  {
    label: "WESTSIDE",
    img: "https://assets.tatacliq.com/medias/sys_master/images/64927656378398.png",
  },
  
  {
    label: "MENSWEAR",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Menswear.jpg",
  },
  {
    label: "HANDBAGS",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Handbags.jpg",
  },
  {
    label: "WATCHES",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Watches.jpg",
  },
  {
    label: "FOOTWEAR",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Footwear.jpg",
  },
  {
    label: "KIDSWEAR",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Kidswear.jpg",
  },
  {
    label: "JEWELLERY",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Jewellery.jpg",
  },
  {
    label: "BEAUTY",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Beauty.jpg",
  },
  {
    label: "HOME & LIVING",
    img: "https://assets.tatacliq.com/medias/sys_master/images/HomeLiving.jpg",
  },
  {
    label: "HEALTHY LIVING",
    img: "https://assets.tatacliq.com/medias/sys_master/images/HealthyLiving.jpg",
  },
  {
    label: "GADGETS",
    img: "https://assets.tatacliq.com/medias/sys_master/images/Gadgets.jpg",
  },
];

function CategoryCards() {
  return (
    <div className="overflow-x-auto whitespace-nowrap px-4 py-6 bg-white">
      <div className="flex gap-4">
        {categories.map((category, index) => (
          <div key={index} className="flex flex-col items-center min-w-[90px]">
            <div className="rounded-xl overflow-hidden shadow-md w-20 h-20 bg-gray-100">
              <img
                src={category.img}
                alt={category.label}
                className="w-full h-full object-cover"
              />
            </div>
            <p className="text-xs mt-2 text-center text-[#541B1B] font-medium">{category.label}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CategoryCards;
